import React from "react";
import { Form, Container, Button } from "react-bootstrap";
import axios from "axios";

const VolunteerForm = () => {
  const [name, setName] = React.useState();
  const [languagesSpoken, setLanguagesSpoken] = React.useState();
  const [occupation, setOccupation] = React.useState();
  const [skills, setSkills] = React.useState();
  const [role, setRole] = React.useState();

  //   axios
  //     .post("/user", {
  //       firstName: "Fred",
  //       lastName: "Flintstone",
  //     })
  //     .then(function (response) {
  //       console.log(response);
  //     })
  //     .catch(function (error) {
  //       console.log(error);
  //     });

  const handleNameChange = (e) => {
    setName(e.target.name);
  };

  const handleLanguagesChange = (e) => {
    setLanguagesSpoken(e.target.value);
  };

  const handleSkillsChange = (e) => {
    setSkills(e.target.value);
  };

  const handlOccupationChange = (e) => {
    setOccupation(e.target.value);
  };

  const handleRoleChange = (e) => {
    setRole(e.target.value);
  };

  //   console.log(name);

  return (
    <Container>
      <Form>
        <Form.Group>
          <Form.Label>Name</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter name"
            onChange={(e) => handleNameChange(e)}
          />
        </Form.Group>
        <Form.Group>
          <Form.Label>Language</Form.Label>
          <Form.Control type="text" placeholder="Enter languages spoken" />
        </Form.Group>

        <Form.Group>
          <Form.Label>Occupation</Form.Label>
          <Form.Control type="text" placeholder="Enter occupation" />
        </Form.Group>

        <Form.Group>
          <Form.Label>Skills</Form.Label>
          <Form.Control type="text" placeholder="Enter skills" />
        </Form.Group>

        <Form.Group>
          <Form.Label>Role</Form.Label>
          <Form.Control type="text" placeholder="Enter role" />
        </Form.Group>
        <Button variant="primary" type="submit">
          Submit
        </Button>
      </Form>
    </Container>
  );
};

export default VolunteerForm;
